import React from 'react';
import { PostForm } from '../components/PostForm';
import { PostCard } from '../components/PostCard';

const dummy = {
    isLoggedIn: true,
    imagePaths: [],
    mainPosts: [{
        User: {
            id: 1,
            nickname: '표서쿤',
        },
        content: '첫 번째 게시글',
    }],
};

const Home = () => {
    return(
        <div>
            { dummy.isLoggedIn && <PostForm/>}
            { dummy.mainPosts.map((c)=>{
                return(
                    <PostCard/>
                );
            }) }
        </div>
    );
}

export default Home;
